import React, {Component} from 'react';
import './App.css';

class App extends Component {

  render(){
  return (
    React.createElement('div', {className: 'App'}, React.createElement('h1', null, 'Hi I\'m a create react app!'))
    // <div className="App">
    //   <h1>Hi, I am a react app</h1>
    //   </div>
  );
}}

export default App;
